import backgroundOfCircle from "../assets/img/landingPage/backgroundOfCircle.png";
import "./CircularItems.css";
import "./moonJs/moonMap.css";
import { Helmet } from "react-helmet";

function CircularItems() {
  return (
    <div
      className=" col-sm-12 cirleOfElements"
      style={{
        backgroundImage: `url(${backgroundOfCircle})`,
      }}
    >
<div id="center" class="orbit-center">
  <span>Center</span>
</div>
<span class="moonSelector">1</span>
<span class="moonSelector">2</span>
<span class="moonSelector">3</span>
<span class="moonSelector">4</span>
<span class="moonSelector">5</span>
<span class="moonSelector">6</span>
<span class="moonSelector">7</span>

      
    </div>
  );
}
export default CircularItems;
